import './App.css';
import React from "react";

class App extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      result: ["nothing"]
    }
  }

  componentDidMount() {
    fetch("http://localhost:8080/coinexchange")
    .then(
        (res) => {
          console.log("respose: "+res);
          this.setState({
            result: res
          });
        }
      );
      console.log("result: "+this.state.result);
  }

  render() {
    console.log(this.state);
    return (
      <div>
        { this.state.result }
      </div>
    );
  }
}


export default App;
